void XTFT_Init_GPIO(void)
{
	TFT_BL_H();// 		R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	//SET

	TFT_CS_H();// 		R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	

	TFT_DC_D();// 		R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	

	TFT_RES_H();// 	R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	

	TFT_SCL_H();// 	R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	

	TFT_MOSI_H();// 	R_IOPORT_PinWrite(&g_ioport_ctrl, BSP_IO_PORT_04_PIN_00, BSP_IO_LEVEL_HIGH)	

} 


/******************************************************************************
      函数说明：LCD串行数据写入函数
      入口数据：dat  要写入的串行数据
      返回值：  无
******************************************************************************/
void  SendDataSPI(unsigned char dat)
{  
   unsigned char i;
   
   for(i=0; i<8; i++)			
   {  
      if( (dat&0x80)!=0 ) 
			OLED_MOSI_SET();
        else 
			OLED_MOSI_CLR();

      dat <<= 1;

	  OLED_CLK_CLR();
	  OLED_CLK_SET();		
   }
}

void WriteComm(unsigned int i)	//DC=0
{
	OLED_CS_Clr();
	OLED_DC_Clr();

	SendDataSPI(i);

	OLED_CS_Set();

}
/******************************************************************************
      函数说明：LCD写入数据
      入口数据：dat 写入的数据
      返回值：  无
******************************************************************************/
void WriteData(unsigned int i)	//DC=1
{
	OLED_CS_Clr();
	OLED_DC_Set();

	SendDataSPI(i);

	OLED_CS_Set();
}

void WriteDispData(unsigned char DataH,unsigned char DataL)
{
	//OLED_CS_Clr();
	//OLED_DC_Set();
	 SendDataSPI(DataH);
	 SendDataSPI(DataL);
	//OLED_CS_Set();

}
/******************************************************************************
      函数说明：LCD初始化
      入口数据：
      返回值：  无
******************************************************************************/
void LCD_Init(void)
{
 
	OLED_RST_Set();
	R_BSP_SoftwareDelay(100, BSP_DELAY_UNITS_MILLISECONDS);
	
	OLED_RST_Clr();
	R_BSP_SoftwareDelay(100, BSP_DELAY_UNITS_MILLISECONDS);

	OLED_RST_Set();
	R_BSP_SoftwareDelay(200, BSP_DELAY_UNITS_MILLISECONDS);

    WriteComm(0x11); //Exit Sleep
	R_BSP_SoftwareDelay(120, BSP_DELAY_UNITS_MILLISECONDS);

	WriteComm(0xB1);
	WriteData(0x05);//0a
	WriteData(0x3c);//14
	WriteData(0x3c);

	WriteComm(0xB2);
	WriteData(0x05);
	WriteData(0x3c);
	WriteData(0x3c);

	WriteComm(0xB3);
	WriteData(0x05);
	WriteData(0x3c);
	WriteData(0x3c);

	WriteData(0x05);
	WriteData(0x3c);
	WriteData(0x3c);

	WriteComm(0xB4);
	WriteData(0x03);

	WriteComm(0xC0); //Set VRH1[4:0] & VC[2:0] for VCI1 & GVDD
	WriteData(0x28);//
	WriteData(0x08);
	WriteData(0x04);//

	WriteComm(0xC1); //Set BT[2:0] for AVDD & VCL & VGH & VGL
	WriteData(0xC0);

	WriteComm(0xC2); //Set VMH[6:0] & VML[6:0] for VOMH & VCOML
	WriteData(0x0D);//54h
	WriteData(0x00);//33h

	WriteComm(0xC3);
	WriteData(0x8D);
	WriteData(0x2A);

	WriteComm(0xC4);
	WriteData(0x8D);
	WriteData(0xEE);

	WriteComm(0xC5);
	WriteData(0x1A);

	WriteComm(0x36); 	//MX,MY,RGB MODE
//	WriteData(0x08);	//反转180
	WriteData(0xC8);	//正向

	WriteComm(0xe0);
	WriteData(0x04);//2c
	WriteData(0x22);
	WriteData(0x07);
	WriteData(0x0A);
	WriteData(0x2E);
	WriteData(0x30);
	WriteData(0x25);
	WriteData(0x2A);
	WriteData(0x28);
	WriteData(0x26);
	WriteData(0x2E);
	WriteData(0x3A);
	WriteData(0x00);
	WriteData(0x01);
	WriteData(0x03);
	WriteData(0x03);

	WriteComm(0xe1);
	WriteData(0x04);
	WriteData(0x16);
	WriteData(0x06);
	WriteData(0x06);
	WriteData(0x0D);
	WriteData(0x2D);
	WriteData(0x26);
	WriteData(0x23);
	WriteData(0x27);
	WriteData(0x27);
	WriteData(0x25);
	WriteData(0x2D);
	WriteData(0x3B);
	WriteData(0x00);
	WriteData(0x01);
	WriteData(0x04);
	WriteData(0x13);

	WriteComm(0x3A); 
	WriteData(0x05);
	
	WriteComm(0x29); // Display On
	R_BSP_SoftwareDelay(20, BSP_DELAY_UNITS_MILLISECONDS);


}

void BlockWrite(unsigned int Xstart,unsigned int Xend,unsigned int Ystart,unsigned int Yend) 
{

	WriteComm(0x2A);             
	WriteData(Xstart>>8);             
	WriteData(Xstart+2);             
	WriteData(Xend>>8);             
	WriteData(Xend+2);             
	
	WriteComm(0x2B);             
	WriteData(Ystart>>8);             
	WriteData(Ystart+1);             
	WriteData(Yend>>8);             
	WriteData(Yend+1);   
	
	WriteComm(0x2c);
}
/******************************************************************************
      函数说明：在指定区域填充颜色
      入口数据：color       要填充的颜色
      返回值：  无
******************************************************************************/
void DispColor(unsigned int color)
{
	unsigned int i,j;

	BlockWrite(0,COL-1,0,ROW-1);


	//OLED_CS_Clr();
	//OLED_DC_Set();

	for(i=0;i<ROW;i++)
	{
	    for(j=0;j<COL;j++)
		{   
			WriteData(color>>8);
			WriteData(color);
			
			//SendDataSPI(color>>8);
			//SendDataSPI(color);
		}
	}


	//OLED_CS_Set();
}




void ST7735_write(uint8_t data)
{
	SendDataSPI(data);
}

void ST7735_cmd(unsigned int cmd)
{
	OLED_CS_Clr();
	OLED_DC_Clr();
	ST7735_write(cmd);
	//while (SPI_I2S_GetFlagStatus(SPI_PORT,SPI_I2S_FLAG_BSY) == SET);
	OLED_CS_Set();
}

void ST7735_data(unsigned int data)
{
	OLED_CS_Clr();
	OLED_DC_Set();
	ST7735_write(data);
	//while (SPI_I2S_GetFlagStatus(SPI_PORT,SPI_I2S_FLAG_BSY) == SET);
	OLED_CS_Set();
}



void writeCmdData ( unsigned char Byte, unsigned char opt ) {
	if ( opt == 1 ) {
		OLED_DC_Clr();
	} else if ( opt == 0 ) {
		OLED_DC_Set();
	}
	OLED_CS_Clr();
	ST7735_write(Byte);
	OLED_CS_Set();
}

uint16_t RGB565(uint8_t R,uint8_t G,uint8_t B) {
	return ((R >> 3) << 11) | ((G >> 2) << 5) | (B >> 3);
}

void ST7735_Init(void) {

	LCD_Init();
}



